// AboutMe.js
import React from 'react';
import style from './AboutMe.module.css'; // Create a CSS module for styling

const AboutMe = () => {
  return (
    <div className={style.aboutMe}>
      <h1>About Me</h1>
      <p>
        I'm a web developer passionate about building dynamic and engaging applications. 
        Here's a bit more about me:
      </p>
      {/* Add more details about yourself */}
    </div>
  );
};

export default AboutMe;
